import React, { useEffect } from 'react';

function Photo() {

    useEffect(() => {
        fetchPhoto();
    }, [])



    const fetchPhoto = async () => {
        const photoURL = 'https://pixabay.com/api/?key=16806694-8789b173812b34e350141a20b&q=yellow+flowers&image_type=photo';

        const photoFetch = await fetch(photoURL);
        const data = await photoFetch.json();

        console.log(data);
    }


    return (
        <h1>Photo</h1>
    );
}

export default Photo;
